insert into international (internationalId,languageId,namespace,message,lastUpdated) values (627,2,'WebGUI','Profile werden genutzt, um sich weitergehende Informationen über einen bestimmten Benuter anzuschauen. Für mache Seiten sind Profile wichtig, für andere wiederum nicht. Das Profilsystem ist komplett anpassbar. Sie können so viel Informationen anzeigen oder anfordern, wie Sie möchten.', 1040655917);
delete from international where languageId=2 and namespace='WebGUI' and internationalId=638;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (638,2,'WebGUI','Templates werden eingesetzt um das Layout in WebGUI festzulegen. Mit WebGUI werden viele Templates ausgeliefert. Und mit der Templateverwaltung können Sie Ihrer eigenen Templates erstellen, damit Ihre Seite genau so aussieht, wie Sie sie sich vorstellen. ', 1040655721);
delete from international where languageId=2 and namespace='WebGUI' and internationalId=639;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (639,2,'WebGUI','<b>Template Name</b><br>\r\nVergeben Sie einen aussagekräftigen Namen, damit Sie später wissen, wofür dieses Template ist.\r\n<br><br>\r\n<b>Namensbereich</b><br>\r\nWelcher Template Typ ist es? z.B. Template für das Textelement\r\n<br><br>\r\n<b>Template</b><br>\r\nBenutzen Sie zur Erstellung des Templates die vorhandenen Template-Befehle und Variablen, Macros und auch HTML-Code.\r\n<br><br>\r\n<b>Beachten Sie:</b><br>\r\nSie sollten niemals die Standardtemplates, die mit WebGUI ausgeliefert werden, bearbeiten, da diese oft mit jeder neuen Version von WebGUI geändert werden. Verfahren Sie stattdessen so, dass Sie ein Template Ihrer Wahl zuerst kopieren und dann mit dieser Kopie weiterarbeiten und z. B. einen neuen Namen vergeben etc.', 1040655572);
delete from international where languageId=2 and namespace='WebGUI' and internationalId=838;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (838,2,'WebGUI','Verzeichnisse (Ordner) werden zum Organisieren von Uploads genutzt, ähnlich wie Sie Dateien auf Ihrer Festplatte in Verzeichnisses sortiert haben.\r\n<br><br>\r\n<b>In Verzeichnisses organisieren</b><br>\r\nVerzeichnisse können sich innerhalb anderer Verzeichnisse befinden. In welchen Ordner möchten Sie diesen Ordner verschieben?\r\n<br><br>\r\n<b>Name</b><br>\r\nBenennen Sie den Ordner so, dass Sie auch erkennen, was sich darin befindet (z. B. Grafiken, Private Bilder, Musikfiles, ...)\r\n<br><br>\r\n<b>Beschreibung</b><br>\r\nGeben Sie eine kurze Beschreibung des Ordners an, so dass Sie sich z. b. warum Sie diesen Ordner erstellt haben, was sich darin befindet, etc.', 1040655148);
delete from international where languageId=2 and namespace='WebGUI' and internationalId=830;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (830,2,'WebGUI','Seiten Templates werden genutzt um Wobjects auf Ihrer Seite zu organisieren. Um dies zu ermöglichen, müssen Sie Template Positionen erstellen. Sie können eine unbegrenzte Anzahl von Postionsnummern in Ihren Seiten-Templates benutzen, aber sie müssen dafür immer eine Position schaffen. Die Template Positions Variablen können ungefähr so aussehen:<br><br>\r\n\r\n<pre>\r\n&lt;tmpl_var page.position1&gt;\r\n&lt;tmpl_var page.position2&gt;\r\n&lt;tmpl_var page.position3&gt;\r\n&lt;tmpl_var page.position4&gt;\r\n&lt;tmpl_var page.position5&gt;\r\n&lt;tmpl_var page.position6&gt;\r\n&lt;tmpl_var page.position7&gt;\r\n&lt;tmpl_var ...&gt;\r\n\r\n</pre>\r\n\r\n\r\nSie können mehr als 1 Million dieser Positionen einsetzen... Das sollte mehr als genug auch für die komplexeste Seite sein.', 1040654716);
delete from international where languageId=2 and namespace='Item' and internationalId=74;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (74,2,'Item','Nachfolgend eine Liste von Template Variablen für Textelement Templates.\r\n<br><br>\r\n<b>attachment.name</b><br>\r\nDer Dateiname für den Anhang\r\n<br><br>\r\n<b>attachment.url</b><br>\r\nDie URL zum Downloaden des Anhangs\r\n<br><br>\r\n<b>attachment.icon</b><br>\r\nDie URL zum Icon für den Anhang (z.B. Symbol für PDF-Dateien)<br>', 1040654374);
delete from international where languageId=2 and namespace='FAQ' and internationalId=73;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (73,2,'FAQ','<b>Frage</b><br>\r\nFügen Sie die Frage hinzu, die in der FAQ erscheinen soll.\r\n<br><br>\r\n<b>Antwort</b><br>\r\nFügen Sie die Antwort hinzu, die für die Frage, die Sie eben eingegeben haben, erscheinen soll.\r\n<br><br>\r\n<b>Als nächstes?</b><br>\r\nMöchten Sie eine neue Frage hinzufügen, so wählen Sie es hier aus.<br>', 1040654126);
delete from international where languageId=2 and namespace='FAQ' and internationalId=71;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (71,2,'FAQ','Es scheint, dass es auf fast auf jeder Website, privaten Homepage, in Intranets oder auch in Extranets einen F.A.Q-Bereich (Frequently Asked Questions) gibt. Dieses Wobject hilft Ihnen, solch eine FAQ aufzubauen.\r\n<br><br>\r\n<b>Template</b><br>\r\nWählen Sie ein Layout für diese FAQ aus.\r\n<br><br>\r\n<b>Als nächstes?</b><br>\r\nWählen Sie \"Eine Frage hinzufügen\", wenn Sie eine neue Frage hinzufügen möchten.<br><br>\r\n<hr>\r\n<b>Beachten Sie bitte:</b> Die nachfolgende Stylesheet Class ist speziell für die FAQ.\r\n<br><br>\r\n<b>faqQuestion</b><br>\r\nEine FAQ Frage. zum Abgrenzen von der Antwort<br>', 1040653967);
delete from international where languageId=2 and namespace='ExtraColumn' and internationalId=71;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (71,2,'ExtraColumn','Extra Spalten erlauben Ihnen, unbhängig vom Gesamtlayout(Style) Ihrer Seite für die momentan ausgewählte Seite eine Zusatzspalte einzufügen.\r\n<br><br>\r\nMöchten Sie mehrere Spalten auf all Ihren Seiten haben, müssen Sie den Style entsprechend bearbeiten oder stattdessen ein Template benutzen.\r\n<br><br>\r\nSpalten werden immer von links nach rechts hinzugefügt. Deswegen erscheint bereits vorhandener Content links von der neuen Spalte.\r\n<br><br>\r\n<b>Platzhalter</b><br>\r\nDer Platzhalter ist die Grösse der Abstände zwischen dem bereits vorhandenen Content und Ihrer neuen Spalte. Angaben in Pixel.\r\n<br><br>\r\n<b>Breite</b><br>\r\nGeben Sie hier bitte die Breite in Pixel für die neue Spalte an.\r\n<br><br>\r\n<b>StyleSheet Class</b><br>\r\nWenn Sie eine spezielle StyleSheet Class für Spalten benutzen, können Sie diese hier angeben.', 1040653582);
delete from international where languageId=2 and namespace='EventsCalendar' and internationalId=73;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (73,2,'EventsCalendar','<b>Titel</b><br>\r\nBezeichnung dieses Ereignisses\r\n<br><br>\r\n<b>Description</b><br>\r\nBeschreibung dieses Ereignisses\r\n<br><br>\r\n<b>Start Datum</b><br>\r\nWann beginnt das Ereignis?\r\n<br><br>\r\n<b>Ende Datum</b><br>\r\nWann endet das Ereignis?\r\n<br><br>\r\n<b>Wiederholt sich</b><br>\r\nWählen Sie einen Wiederholungszeitraum für dieses Ereignis aus\r\n<br><br>\r\n<b>Als nächstes?</b><br>\r\nWählen Sie \"Neues Ereignis hinzufügen\", wenn Sie ein neues Ereignis hinzufügen möchten, andernfalls wählen Sie \"Zurück zur Seite\".\r\n<br>', 1040652689);
