insert into international (internationalId,languageId,namespace,message,lastUpdated) values (4,2,'Auth/SMB','SMB Anmeldefehler (3)<br>\r\nSie haben einen falschen Benutzernamen oder ein falsches Kennwort eingegeben. Bitte versuchen Sie es noch einmal.', 1040651997);
