delete from international where languageId=2 and namespace='WebGUI' and internationalId=416;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (416,2,'WebGUI','<h1>Abfrageproblem</h1> Ihre Anfrage macht dem\r\nSystem Probleme. Bitte betätigen Sie den Zurückbutton im Browser und\r\nversuchen Sie es nochmal. Sollte dieses Problem weiterbestehen, teilen Sie uns bitte mit, was Sie wo im System wann gemacht haben.', 1040651888);
delete from international where languageId=2 and namespace='Article' and internationalId=73;
insert into international (internationalId,languageId,namespace,message,lastUpdated) values (73,2,'Article','Die nachfolgenden Template Variablen sind für Artikel Templates verfügbar.<br><br>\r\n\r\n<b>attachment.box</b><br>\r\nGibt eine Standard WebGUI Anlagen-Box aus mit Icon, Dateiname und Anlageindikator. \r\n<br><br>\r\n<b>attachment.icon</b><br>\r\nDie URL zum Icon-Symbol für diesen Anlagentyp.\r\n<br><br>\r\n<b>attachment.name</b><br>\r\nDer Dateiname für diese Anlage.\r\n<br><br>\r\n<b>attachment.url</b><br>\r\nDie URL zum Downloaden dieser Anlage. \r\n<br><br>\r\n<b>image.thumbnail</b><br>\r\nDie URL zum Thumbnail für die angefügte Grafik.\r\n<br><br>\r\n<b>image.url</b><br>\r\nDie URL zur angefügten Grafik. \r\n<br><br>\r\n<b>post.label</b><br>\r\nDas übersetzte Label um Kommentare zu diesem Artikel hinzuzufügen. \r\n<br><br>\r\n<b>post.URL</b><br>\r\nDie URL um einen Kommentar zu diesem Artikel hinzuzufügen. \r\n<br><br>\r\n<b>replies.count</b><br>\r\nDie Anzahl d!
 er Kommentare zu diesem Artikel. \r\n<br><br>\r\n<b>replies.label</b><br>\r\nDer übersetzte Text, der anzeigt, dass Sie die Kommentare anschauen können..\r\n<br><br> \r\n\r\n<b>replies.url</b><br>\r\nDie URL, um die Kommentare zu diesem Artikel anzuschauen.', 1040651575);
